import React from "react";

const sidebar = () => {
  return (
    <div class="container_left_side">
      <h1>Kanban</h1>
      <h4>ALL BOARDS (8)</h4>
      <div class="resturant_details">
        <h5>Platform Lunch</h5>
        <h5>Marketing Plan</h5>
        <h5>Roadmap</h5>
        <p>+Create New Board</p>
      </div>
    </div>
  );
};

export default sidebar;
